COMPANY_METADATA_DESCRIPTION:"Apply for jobs at Discord HQ and build a sweet chat app that millions of gamers use to play with their friends. Check out company information including perks and location.",COMPANY_FOUNDED_HEADING:"Who we are",COMPANY_FOUNDED_TEXT:"Gamers, nerds, moms, dads, engineers, designers, marketers, support. Discord is a small group of passionate gamers whose mission is to bring people together around games. Diversity and inclusiveness are a critical part of how we get there. We believe that with diversity comes a better product, better decisions, and a better work environment. Everyone here is committed to making Discord representative of the world we want to live and play in.",COMPANY_HERO_HEADING:"We built Discord to bring gamers together",
COMPANY_HERO_TEXT:"The best relationships in our lives were built around playing games. Memories of staying up late playing Warcraft 3 with friends or sharing creations in The Sims mean so much to us. Discord's free voice and text chat is about making it easier for you to spend time with the people you care about, create these memories, and land a headshot or two.",COMPANY_HIRING_BUTTON:"Check out our open positions",COMPANY_HIRING_HEADING:'Come make some Discord in "Sunny" San Francisco',COMPANY_HIRING_TEXT:"Become part of a passionate group of gamers passionate about passionately crafting exceptional products theyre passionate about. Whew.",COMPANY_INVESTORS_HEADING:"Some of the smartest investors believe in us",COMPANY_INVESTORS_TEXT:"We've raised over {fundingAmount} from top VCs in the valley like Greylock, Benchmark, and Tencent. In other words, we'll be around for a while.",COMPANY_PRESS_HEADING:"Well just leave these here...",
