COMPANY_REBRAND_METADATA_DESCRIPTION:"Our mission is create space for everyone to find belonging. We're building an easy-to-use communication service that gives people a place to talk, build relationships, and create that space.",COMPANY_REBRAND_HERO_TITLE_2:"Create space for everyone to find belonging",COMPANY_REBRAND_HERO_SUBTITLE_2:"Its where your world hangs out. Discord is a voice, video and text communication service used by over a hundred million people to hang out and talk with their friends and communities.",COMPANY_REBRAND_HISTORY_TITLE:"Our Story",
COMPANY_REBRAND_HISTORY_SUBTITLE:"Discord is about giving people the power to create space to find belonging in their lives. We want to make it easier for you to talk regularly with the people you care about. We want you to build genuine relationships with your friends and communities close to home or around the world. Original, reliable, playful, and relatable. These are the values that connect our users and our employees at Discord.",COMPANY_REBRAND_HISTORY_BEGINNING_TITLE:"Prologue",
COMPANY_REBRAND_HISTORY_BEGINNING:"Discord was started to solve a big problem: how to communicate with friends around the world while playing games online. Since childhood, founders Jason Citron and Stan Vishnevskiy both shared a love of video games, cherishing the friendships and connections that formed while playing them. At the time, all the tools built for this job were slow, unreliable, and complex. Jason and Stan knew they could make a better service that encouraged talking, helped form memories, and recreated the feeling of togetherness all found through gaming.",COMPANY_REBRAND_HISTORY_START_TITLE:"Chapter One",
COMPANY_REBRAND_HISTORY_START:"So, in 2015, Stan and Jason started to bring Discord to life. People from all over the world loved it. Discord made it easy to genuinely communicate with friends, going beyond casual talking. Friends were staying in touch with their various communities. Discord was making it easy to participate in conversation, hopping around text, voice and video to talk. The technology was complex but the goal was simple: make Discord an inviting and comfortable home to jump into with your communities and friends. Within a few years, Discord began to take off, and devoted people who loved our product sprung up around the world.",COMPANY_REBRAND_HISTORY_TODAY_TITLE_2:"Where are we now?",
COMPANY_REBRAND_HISTORY_TODAY:"Discord is used by everyone from local hiking clubs, to art communities, to study groups. Discord has millions of people creating places for their friends and communities, talking for upwards of 4 hours per day on the platform. Discord is now where the world talks, hangs out, and builds relationships. Discord lets anyone create a space to find belongingjust like it did for Jason and Stan.",COMPANY_REBRAND_METRICS_TITLE:"Our metrics",COMPANY_REBRAND_OFFICES:"Our office",COMPANY_REBRAND_HIRING_HEADING:"Come make some Discord with us",COMPANY_REBRAND_HIRING_BUTTON_2:"Open Jobs",COMPANY_REBRAND_HIRING_TEXT_2:"Become part of a group of passionate people passionately crafting exceptional products theyre passionate about. Were also passionate about health and safety, so youll be kicking it from your couch while our office is closed.",COMPANY_REBRAND_METRICS_MONTHLY_ACTIVE_USERS_VALUE:"150 Million",
