JOB_FORM_EEOC_STATEMENT:"Discord is committed to diversity and inclusion throughout someones entire Discord experience. Participating in this voluntary survey will help us understand the diversity of our candidates and evaluate where we can do more. This survey is completely voluntary and anonymous and not attached to your application in any way. It is not visible by hiring managers and participation in this survey does not impact the outcome of your application. Declining to fill out this survey will not affect your Discord experience. Thank you for helping us evolve our diversity and inclusion efforts.",JOB_ANTI_DISCRIMINATION_NOTICE:"Anti-Discrimination Notice: It is an unlawful employment practice for an employer to fail or refuse to hire or discharge any individual, or otherwise to discriminate against any individual with respect to that individuals terms and conditions of employment, because of such individuals race, color, religion, sex, or national origin.",
