JOBS_JOBS_TEXT:"We know that diverse teams make better products, better decisions, and foster a better work environment. As we continue to grow, [our values keep us dedicated]({link}) to building a company that is representative of the world we live and play in. We'd love your help.",JOBS_JOBS_ERROR_HEADING:"Oh Geez",JOBS_JOBS_LOADING_HEADING:"Please hold, loading job data",JOBS_PERKS_HEADING:"Boss tier perks and benefits",JOBS_PERKS_TITLE_1:"Health Pack",JOBS_PERKS_TEXT_1:"We take care of our team with comprehensive Medical (HMO or PPO), Dental, and Vision plans at no cost for employees.",JOBS_PERKS_TITLE_2:"Parental Leave",JOBS_PERKS_TEXT_2:"Paid leave for new parents to spend some quality time with the next generation of gamers!",JOBS_PERKS_TITLE_3:"Take a Load Off",JOBS_PERKS_TEXT_3:"Stay refreshed with 13 paid holidays, use-what-you-need sick days, and four weeks of PTO.",JOBS_PERKS_TITLE_4:"Commute easy",
JOBS_PERKS_TEXT_4:"Fully subsidized commuter and parking benefit (up to $265/month). Get over here!",JOBS_PERKS_TITLE_5:"The Loadout",JOBS_PERKS_TEXT_5:"Awesome daily catered lunches and snacks. A desk fund to make your space yours. Whatever you need for your computer setup, including a headphone allowance.",JOBS_PERKS_TITLE_6:"Its Fitness Time",JOBS_PERKS_TEXT_6:"Workout on us! A fitness allowance for your gym membership or favorite workout class. Yoga in office every Thursday.",JOBS_PERKS_TITLE_7:"Insurance Suite",JOBS_PERKS_TEXT_7:"Basic Life & AD&D, Disability, Supplemental Life, and Accident insurance.",JOBS_PERKS_TITLE_8:"Discord HQ",JOBS_PERKS_TEXT_8:"Our office is located in Potrero Hill, a little neighborhood in SF near awesome coffee, food, and Whole Foods. Also sushi.",JOBS_PERKS_TITLE_9:"Relocation",JOBS_PERKS_TEXT_9:"Excellent customized relocation packages for new hires.",JOBS_FILTER:"Filter Jobs",JOBS_FILTER_NONE:"Featured",
JOBS_REFRESH_METADATA_TITLE:"Jobs and Career Opportunities at Discord",JOBS_REFRESH_METADATA_DESCRIPTION:"Apply for jobs at Discord and build an easy-to-use communication service for people to talk, chat, and hang out.",JOBS_REFRESH_HERO_HEADING:"Work at Discord",JOBS_REFRESH_HERO_BODY:"Discord is home to passionate people who value our missionempowering you to create belonging in your life.",JOBS_REFRESH_DESCRIPTION_TITLE_2:"We'd love to work with someone like you.",
JOBS_REFRESH_DESCRIPTION_BODY_3:"We care about creating a delightful experience: for people who use Discord and for ourselves. We value a workplace that's as diverse as our product. People here do work that matters. We keep moving forward with a figure-it-out mentality. And above all, we remember to work with empathy, kindness, and compassion.\n\n  All of [our values]({blogLink}) help us make a better product, better decisions, and foster a better work environment. As we continue to grow, we stay dedicated to building a company that is representative of the world we live and play in. We'd love your help.\n  ",JOBS_REFRESH_FILTER:"Filters",JOBS_REFRESH_PERKS_TITLE:"Top-tier perks and benefits:",JOBS_REFRESH_PERKS_DISCORD_HQ_TITLE:"Discord HQ",
JOBS_REFRESH_PERKS_DISCORD_HQ_BODY:"Our platform is our headquarters! Because we believe great work isn't tied to a physical space, most of our roles offer flexibility  whether it's from the comfort of your home (in approved locations), an inspiring office setting or a combo of both! No matter where your desk lives, we offer generous support to help you remain productive and engaged.",JOBS_REFRESH_PERKS_GROW_TOGETHER_TITLE:"Grow together",JOBS_REFRESH_PERKS_GROW_TOGETHER_BODY:"Look forward to developing both professionally and personally alongside your colleagues at Discord. All of our managers go through a leadership program, and we offer diverse trainings for everyone. No matter what your interests or skills are, there's a place on our platform for you to find and build belonging.",JOBS_REFRESH_PERKS_MONEY_TITLE:"Money matters",
JOBS_REFRESH_PERKS_MONEY_BODY:"Discord strives to offer fair and competitive compensation packages, including equity. You'll have room to grow and be rewarded based on your contributions and impact at the company.  Take advantage of our retirement offerings (including 401k matching in the U.S.) to meet your financial goals.",JOBS_REFRESH_PERKS_HEALTH_TITLE:"Health benefits",JOBS_REFRESH_PERKS_HEALTH_BODY:"At Discord, we health-care about you! We offer flexible health plans that cover both physical and mental healthcare.",JOBS_REFRESH_PERKS_FAMILY_TITLE:"Family support",JOBS_REFRESH_PERKS_FAMILY_BODY:"Spend some quality time with the next generation with parental leave, fertility, adoption, and surrogacy benefits.",JOBS_REFRESH_PERKS_REST_TITLE:"R&R",JOBS_REFRESH_PERKS_REST_BODY:"Stay refreshed with four weeks of PTO, 14+ paid holidays and flexible sick time (which includes mental health days).",JOBS_REFRESH_PERKS_GENDER_TITLE:"Gender-affirming care",
JOBS_REFRESH_PERKS_GENDER_BODY:"Many medical insurance providers consider much of the treatment vital to ones gender transition as cosmetic. We dont. Use up to $20,000 for transition-related procedures.",JOBS_REFRESH_PERKS_WELLNESS_TITLE:"Wellness on us",JOBS_REFRESH_PERKS_WELLNESS_BODY:"Take advantage of a quarterly stipend for your gym membership or other activities to keep you feeling great. Plus virtual yoga every week!",JOBS_REFRESH_PERKS_CHARITY_TITLE:"Giving back",JOBS_REFRESH_PERKS_CHARITY_BODY:"Whatever social cause youre passionate about, take a day (or two) off to make an impact. While you're at it, take advantage of $1,000/year in donation matching to charitable organizations!",
JOBS_REFRESH_FOOTER_2:"If you're wanting to work with a motivated team on something that gives millions of users a space to find belonging, check out the four values of working at Discord [on our blog]({blogLink}). For all roles, we're hiring people to join us in our beautiful San Francisco office, and for select, indicated positions, we're currently open to having people join our team remotely in these states:\n\n\n  Alabama - Arizona - California - Colorado - District of Columbia - Florida - Georgia - Illinois - Iowa - Maine - Massachusetts - Maryland - Michigan - Minnesota - Missouri - Montana - Kansas - Nevada - New Hampshire - New Jersey - New Mexico - New York - North Carolina - Oklahoma - Oregon - Pennsylvania - Rhode Island - Texas - Utah - Vermont - Virginia - Washington\n  ",
