LANDING_HERO_SUBTITLE:"Whether youre part of a school club, gaming group, worldwide art community, or just a handful of friends that want to spend time together, Discord makes it easy to talk every day and hang out more often.",LANDING_FEATURE_INVITE_ONLY_TITLE:"An invite-only place with plenty of room to talk",LANDING_FEATURE_INVITE_ONLY_BODY:"Discord servers are organized into topic-based channels where you can collaborate, share, and just talk about your day without clogging up a group chat.",LANDING_FEATURE_INVITE_ONLY_IMG_ALT:"Stylized image of a Discord server with multiple channels for studying, games, cooking, and pet photos.",LANDING_FEATURE_HANGOUT_TITLE:"Where hanging out is easy",LANDING_FEATURE_HANGOUT_BODY:"Grab a seat in a voice channel when youre free. Friends in your server can see youre around and instantly pop in to talk without having to call.",LANDING_FEATURE_HANGOUT_IMG_ALT:"Stylized image showing friends hanging out in multiple voice channels.",
