STREAMKIT_LEARN_MORE:"Learn More",STREAMKIT_APPS_YOU_KNOW_TITLE:"The apps you know and love",STREAMKIT_APPS_YOU_KNOW_SUBTITLE:"We sent some emails. We high-fived some people. We even had to make a phone call. Lots of work to make sure YOU have the best and brightest tools to do the important thing: streaming.",STREAMKIT_HAPPY_FUN_TIME_TITLE:"Happy fun time",STREAMKIT_HAPPY_FUN_TIME_SUBTITLE:"Because every community needs a little fun to go with all that moderation stuff.",STREAMKIT_PATREON_TITLE:"Patreon",STREAMKIT_PATREON_SUBTITLE:"Allow Discord to automatically sync your patrons to a role. This integration can let you give exclusive access to private rooms, the ability to post links, or even join voice chat.",STREAMKIT_PATREON_FEATURE_SYNC:"Sync Patreon patrons to a Discord role",STREAMKIT_PATREON_FEATURE_REWARD_ROLES:"Assign different roles based on which rewards patrons subscribe to",STREAMKIT_NIGHTBOT_TITLE:"Nightbot",
